CREATE TABLE m_live_note_wave_gimmick_group(
  live_difficulty_id INTEGER NOT NULL,
  wave_id INTEGER NOT NULL,
  state INTEGER NOT NULL,
  skill_id INTEGER NOT NULL,
  name TEXT NOT NULL,
  description TEXT NOT NULL,
  PRIMARY KEY (live_difficulty_id, wave_id, state, skill_id),
  FOREIGN KEY (live_difficulty_id) REFERENCES m_live_difficulty(live_difficulty_id),
  FOREIGN KEY (skill_id) REFERENCES m_skill(id)
);
